/** @format */

import React from 'react';
import Header from './NavBar.js';
import profile from '../images/profile.png';

const CV = () => {
	return (
		<div>
			<Header />
			<h1>Executive Chef Yannick</h1>
			<img src={profile} alt='this is car image' />
			<div className='desc'>
				<h3>
					French native, Yannick received his formal culinary training in
					Michelin star restaurant at the age of 16; apprentice in Pastry,
					Yannick has develop a profound culinary knowledge in the kitchen and
					pastry division, before his first chef de cuisine position at the age
					of 27.
				</h3>
				<h3>
					Chef Yannick brings over 30 years experience, with exposure working in
					Europe, Asia and Middle East. That allows chef Yannick to develop
					extensive knowledge in Asian and International cuisine, yet Classical,
					Modern and with a Gourmet flair.
				</h3>
				<h3>
					Currently based “in house chef” since 2008 at Morgan Stanley Hong
					Kong, chef Yannick works as Executive Chef managing his team in a
					corporate environment, various nature of events, business, summit,
					conference and for both internal and external events covering the
					whole APAC region.
				</h3>
			</div>
		</div>
	);
};

export default CV;
